import React from 'react'
import { ProjectHeader, ProjectLand } from '../../components'
import './projects.css'

export  function Projects({toggleTheme, theme, toggleLoading, loading}) {
  return (
    <div>
     <ProjectHeader theme={theme} toggleTheme={toggleTheme} toggleLoading={toggleLoading} loading={loading}/>
     <ProjectLand/>
    </div>
  )
}
